const change_config_handler = () => {
  var projection = d3.geoMercator()
    .center([config.longitude, config.latitude]);
  plotset.map.refresh(data, statesMap, config, width, height, projection);
  addFont();
}

const resizeHandler = () => {
  var projection = d3.geoMercator()
    .center([config.longitude, config.latitude]);
  plotset.map.refresh(data, statesMap, config, width, height, projection);
  addFont();
}

function addFont() {
  var svg = d3.select("#chart-wrapper").select("svg");
  svg.append("defs").append("style")
    .attr("type", "text/css").text(
      `@font-face {
    font-family: "Plus Jakarta Sans";
    font-family: "Plus Jakarta Sans";
      font-weight: 100 900;
      font-style: normal italic;
      src: url(data:application/octet-stream;base64,);
  }`
    );
  svg.selectAll("text")
    .attr("font-family", 'Plus Jakarta Sans')
  }



module.exports = {
  change_config_handler,
  resizeHandler,
  init_handler,
  transformData
}
